<script setup lang="ts">
import { onMounted, onUnmounted, ref } from "vue";
import { useRouter } from "vue-router";

const router = useRouter();
const count = ref(5);
const timer = ref<any>(null);

const back = () => {
  router.back();
};

onMounted(() => {
  startCounter();
});

const startCounter = () => {
  timer.value = setInterval(() => {
    if (count.value === 0) {
      clearInterval(timer.value);
      back();
    }
    count.value--;
  }, 1000);
};

onUnmounted(() => {
  clearInterval(timer.value);
});
</script>

